import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import {App} from './App';
import DropdownExampleMultipleSearchSelection from './dropdown'
import {Review, Reviewer, Test, Tester, GiveReview} from './review'
import * as serviceWorker from './serviceWorker';




ReactDOM.render(<App />, document.getElementById('root'));



ReactDOM.render(<Test />, document.getElementById('test'));

ReactDOM.render(<Tester />, document.getElementById('tester'));

ReactDOM.render(<GiveReview />, document.getElementById('give'));

ReactDOM.render(<DropdownExampleMultipleSearchSelection />, document.getElementById('dropdown'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
